import React from 'react';
import { Link } from "react-router-dom";
import "./style.css";
import { Container } from "../Grid";
import Nav from 'react-bootstrap/Nav'

function NavBar() {
  return (
    <div>
      <Container>
        <Nav fixed variant="tabs" defaultActiveKey="/login">

        <Nav.Item>
        <Nav.Link className="messier navbar-brand navbar navbar-expand-lg" href="/">
        MESSIER
        </Nav.Link>
        </Nav.Item>


      <Link className="navbar-brand navbar navbar-expand-lg"  to="/journal">
        Journal
      </Link>

      <Link className="navbar-brand navbar navbar-expand-lg"  to="/moodTracker">
        Mood
      </Link>


      <Link className="navbar-brand navbar navbar-expand-lg"  to="usersAccount">
        Account
      </Link>

      </Nav>
      </Container>
    </div>
  );
}

export default NavBar;
